import RustySwordImg from './rusty-sword.png';

const RustySword = {
  name: 'Rusty Sword',
  type: 'weapon',
  kind: 'melee',
  effect: {},
  range: 1,
  damage: '1d4 + 4',
  image: RustySwordImg,
  value: 10,
};

export default RustySword;
